import React from 'react'
import { Card, Col, Container, Row } from 'react-bootstrap';

const Product = () => {
  return (
    <Container className='shop-app-product'>
        <Row>
            <Col>
             <Card>
             <Card.Body>
                <Card.Image>
                    <h1>Hello</h1>
                    {/* <img src="https://images-na.ssl-images-amazon.com/images/I/71RZxhZXb2L.jpg" alt="" /> */}
                </Card.Image>
             </Card.Body>
             </Card>
            </Col>
        </Row>
    </Container>
  )
}

export default Product;
